import { Button } from "@mui/material";
import React from "react";
import Carousel from "react-material-ui-carousel";
import { useNavigate } from "react-router-dom"

function Item({ item }) {
  const nav = useNavigate();

  const handelLink = (() => {
    nav(item.link)
  })

  const blockStyle =  {
    width: "75vw",
    height: "75vh" 
  }

  const inStyle = {
    width: "100%", 
    height: "90%",
    objectFit: "contain",
  }

  return (
    <div style={blockStyle}>
      {
        <img
          src={item.url}
          alt="Carousel"
          style={inStyle}
        />
      }
      <br />
      {

        <Button 
          variant="contained"
          style={{
            marginTop: "-360px",
            marginLeft: "50px",
          }}
          onClick={handelLink}
        >
          {item.name}
        </Button>
      }
      <br />
      <p
        style={{
          marginTop: "-260px",
          marginLeft: "50px",
          color:"#fff"
        }}
      >
        {item.description}
      </p>
    </div>
  );
}

